draw(a--b--c);

draw(A--b,1pt+dotted);

label("$B$",b,W);
label("$G$",A,NE);

dot(A);
dot(b);

[/asy] The final Answer is 125
 ### Proof
 $BG$ is a diagonal along one face of the cube. Since this diagonal splits the square face into two $45-45-90$ triangles, the diagonal is $\sqrt{2}$ times longer than a side of the square, so a side of the square measures $5\sqrt{2}/\sqrt{2}=5$ units.
 Thus, the volume of the cube is $5^3=\boxed{125}$ cubic units.
 *)

theorem
fixes BG :: real and volume :: real
assumes h0 : "BG = 5 * sqrt 2"
and h1 : "\<forall> s. volume = s powr 3"
and h2 : "\<forall> s BG. s = BG / sqrt 2"
shows  "volume = 125"
 proof- 
  show ?thesis sledgehammer

